        [Test]
        public void FileNameParserTest()
        {
            
            Dictionary<string, string[]> testStringAndResults = new Dictionary<string, string[]>();
            testStringAndResults.Add(
                "a.jpg_$_abc0a0werewr_$_ChatImage_$_image",
                new string[]
                { "a.jpg_$_abc0a0werewr_$_ChatImage_$_image", "ChatImage","image",  "0", "0","False" }
                );
            testStringAndResults.Add(
            "a_jpg_$_abc0a0werewr_$_ChatImage_$_image_50X100",
            new string[]
            { "a_jpg_$_abc0a0werewr_$_ChatImage_$_image", "ChatImage","image",   "50", "100","True" }
            );
            foreach(KeyValuePair<string,string[]> testPire in testStringAndResults)
            {
                string fileName = testPire.Key;

            string cleanName, domainType;
            FileType FileType;
            int tWidth, tHeight;
            bool isThumbnail;
            MediaServer.ServerSettings.FileNameParser(fileName,
                out FileType, out domainType,
                out cleanName, out isThumbnail, out tWidth, out tHeight);

            Assert.AreEqual(testPire.Value[0], cleanName);
            Assert.AreEqual(testPire.Value[1]+"\\", domainType);
            Assert.AreEqual(testPire.Value[2], FileType.ToString());
                Assert.AreEqual(testPire.Value[3], tWidth.ToString());
                Assert.AreEqual(testPire.Value[4], tHeight.ToString());
                Assert.AreEqual(testPire.Value[5], isThumbnail.ToString());
            }
        }
      
    }
